I have a shitty Heklina tail …er, tale to share. At the Heklina memorial in San Francisco, both BenDeLaCreme and Alaska performed rimming tributes in Heklina's honor and it reminded me of that time in the 90's I had a major mishap at the 'Shack while performing the same gag. It was Heklina's birthday and she chose to do a Cure Tribute Night as the theme. I was co-hosting the show and after Heklina opened the night doing "Let's Go To Bed", I did my number. BTW, I was convinced Heklina chose that song so she could wear pajamas all night as her "drag". Anyway, I came out dressed as Heklina (wearing her clothes and wig) and did "Why Can't I Be You?" and did things she would do like count money and at some point I pulled her out onstage and acted like I was rimming her. You see, she was famous for rimming people. Well, I'd hidden a ziplock bag with chocolate pudding in it onstage that I'd poked a hole into. But when I went down behind her to squeeze the fake poo around my lips, it barely came out. I guess I panicked and squeezed too hard because the bag exploded into my face, up my nose, and into my eyes. I then had to host the show looking shit-faced because it was too much to wipe off. Another cherished memory!

#heklina #peacheschrist #trannyshack #thecure
